import React from "react";
let logoUrl =
  "https://i.ibb.co.com/KLDFxr7/Whats-App-Image-2025-01-06-at-11-56-01-74a47a32-removebg-preview.png";

const Logo = () => {


  return (
    <div
      className="logo-box"
      style={{
        backgroundImage:
          'url("https://i.ibb.co.com/KLDFxr7/Whats-App-Image-2025-01-06-at-11-56-01-74a47a32-removebg-preview.png")',
      }}
    ></div>
  );
};

export default Logo;
